<body>
    <script>
        function gooseFilter(birds) {
            var geese = ["African", "Roman Tufted", "Toulouse", "Pilgrim", "Steinbacher"];

            let filteredBirds = birds.filter((bird) => {
                return !geese.includes(bird);


            })
            return filteredBirds;
        }
    </script>
